import React from "react";
import logo from "../../assets/images/logo.png"
import "../Logos/Logos.scss"



class Logos extends React.Component {
        render () {
            return (
                <div>
                    <img src={logo} className="App-logos" alt="Logos"></img>
                </div>
            )
        }
}

export default Logos;
